sys_variable_value.value:
(function execute(inputs, outputs) {

  var table = inputs.table;
  var fields = inputs.fields;
  fields = fields.split(",");

  outputs.file_header = "";

  var tableGr = new GlideRecord(table);
  tableGr.setLimit(1);
  tableGr.query();
  tableGr.next();

  for(var i in fields){

    var f = tableGr.getElement(fields[i]);
    var ed = f.getED();
    var label = ed.getLabel();

    outputs.file_header += label;

    if(i < fields.length-1)
      outputs.file_header += ",";
  }

  var newLine = String.fromCharCode(13) + String.fromCharCode(10);
  outputs.file_header += newLine;

})(inputs, outputs);

